import { useState, useEffect } from "react";


export default function App (){

const[users, setUsers] = useState([])

useEffect( function (){
fetch('https://api.github.com/search/repositories?q=react&per_page=10&page=1')
.then(preResult => preResult.json())
.then(result => setUsers(result.items))
console.log(users);
}, [])

let count = 0;

function increment(){
return count++
}


return(
<div className="main">
    <button onClick={increment}>next</button>
    <button>prev</button>

    {users.map(repo => <div key={repo.id} className="list">{repo.id +"- -"+ repo.full_name} <a
            href={repo.html_url}>Repositories URL</a> </div> )}
</div>
)
}
